    false,nt"url": null,nt"notes": "The Atlantic Flyway Sea Duck Survey, conducted
    from 1991 to 2002 by the U.S. Fish and Wildlife Service, was established to record
    sea duck numbers using near shore (within 700 m of shore) habitats from Cape Breton,
    Nova Scotia to Jacksonville, Florida. Existing breeding population surveys for North
    American waterfowl do not cover the core ranges of about half of North American
    sea duck species. Many species of North American sea ducks breed across vast Arctic
    regions that are difficult and costly to survey. Winter waterfowl surveys such as
    the Mid-winter Waterfowl Survey typically do not cover near shore or offshore coastal
    habitats used by sea ducks. The Atlantic Flyway Sea Duck Survey, conducted by the
    U.S. Fish and Wildlife Service from 1991 to 2002, recorded sea duck numbers using
    near shore (within 700 m of shore) habitats from Cape Breton, Nova Scotia to Jacksonville,
    Florida.  Efforts are currently underway by the Division of Migratory Bird Management,
    working with the Sea Duck Joint Venture and the Atlantic Flyway, to evaluate alternative
    survey methodologies for winter sea ducks. In particular, methods to survey aggregated,
    mobile populations in near and offshore waters and to evaluate detection rates are
    currently under consideration.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
